//src/components/AddQuestionButton.js
import React from 'react';

const AddQuestionButton = ({ onClick }) => {
  return (
    <button
      style={{
        position: "absolute", 
        bottom: "10px",
        left: "10px", 
      }}
      className="button-custom"
      onClick={onClick}
    >
      Add Question
    </button>
  );
};

export default AddQuestionButton;
